import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import AddShoplisting from './add/AddShoplisting';
import EditShoplisting from './edit/EditShopListing';

function App() {
  const navigate = useNavigate();

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Welcome to the App</h1>

          {/* Buttons to navigate to Add and Edit pages */}
          <div>
            <Link to="/add">
              <button>Go to Add Page</button>
            </Link>
            <Link to="/edit">
              <button onClick={navigate("/")}>Go to Edit Page</button>
            </Link>
          </div>
        </header>

        {/* Define Routes */}
        <Routes>
          <Route path="/add" element={<AddShoplisting />} />
          <Route path="/edit" element={<EditShoplisting />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
